* Argon Design System React - v1.1.1
=========================================================

* Product Page: https://www.creative-tim.com/product/argon-design-system-react
* Copyright 2022 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/argon-design-system-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React, { createContext } from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";
import 'react-image-lightbox/style.css';

import "assets/vendor/nucleo/css/nucleo.css";
import "assets/vendor/font-awesome/css/font-awesome.min.css";
import "assets/scss/argon-design-system-react.scss?v1.1.0";

import Index from "views/Index.js";
import Landing from "views/examples/Landing.js";
import Login from "views/examples/Login.js";
import Profile from "views/examples/Profile.js";
import Register from "views/examples/Register.js";
import Detail from "views/examples/Detail";
import Cart from "views/examples/Cart";
import Order from "views/examples/Order";
import mockAllProducts from "./data/mockAllProducts.json";
export const DataContext = createContext();



const allProducts = mockAllProducts.products;

function index () {
  return (
    <DataContext.Provider value={{
      allProducts: allProducts
    }} >
      <BrowserRouter>
  
        <Switch>
          <Route path="/" exact render={(props) => <Index {...props} />} />
          <Route
            path="/landing-page"
            exact
            render={(props) => <Landing {...props} />}
          />
          <Route
            path="/login-page"
            exact
            render={(props) => <Login {...props} />}
          />
          <Route
            path="/profile-page"
            exact
            render={(props) => <Profile {...props} />}
          />
          <Route
            path="/register-page"
            exact
            render={(props) => <Register {...props} />}
          />
          <Route
            path="/detail-page/:product_id"
            exact
            render={(props) => <Detail {...props} />}
          />
          <Route
            path="/cart-page/:product_id&&:size"
            exact
            render={(props) => <Cart {...props} />}
          />
          <Route
            path="/order-page/:product_id&&:size"
            exact
            render={(props) => <Order {...props} />}
          />
          <Redirect to="/landing-page" />
        </Switch>
  
      </BrowserRouter>
    </DataContext.Provider>
  )
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<index />)
